import Home from "./components/home";
import Nav from "./components/nav";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useNavigate,
  Navigate,
} from "react-router-dom";

function App() {
  return (
    <Router>
      <Nav />
      <Routes>
        <Home />
      </Routes>
    </Router>
  );
}

export default App;
